import React from "react";
import { Navbar, Nav, NavbarBrand, NavItem } from "react-bootstrap";
import "../Styles/header.css";

export class NavBar extends React.Component {
  render() {
    return (
      <div>
        <Navbar className="navtheme" style={{ padding: 0 }}>
          <NavbarBrand className="logo">
            <img
              src={require("../Images/logo.png")}
              alt="logo"
              height="53px"
              width="200px"
            />
          </NavbarBrand>
          <Nav id="navItem">
            <Nav.Link href="/" id="navItem">
              Find Companion
            </Nav.Link>
            <NavItem style={{ padding: 0 }}>
              <Nav.Link id="navItem" href="/">
                Friends
              </Nav.Link>
            </NavItem>
            <NavItem style={{ padding: 0 }}>
              <Nav.Link href="/" id="navItem">
                Explore Restaurants
              </Nav.Link>
            </NavItem>
          </Nav>
        </Navbar>
      </div>
    );
  }
}

export default NavBar;
